# filename          : resolve_function.py
# description       : 
# As obfuscation technique, Emotet resolves API functions right before
# they are used and does not import them or use GetProcAddress.
# Functions which are resolved are saves as hashes inside the binary.
# By traversing the exported functions of loaded DLLs, 
# Emotet calculates the hash of the function name and  compares it
# to the hash inside the binary. If the hashes match, 
# this is the requested function and the address is saved in eax. 
# Using "call eax" the function is subsequently called by the binary.
# 
# Guessing for performance reasons Emotet creates a data structure 
# which caches already resolved functions. Therefore traversing and
# calculating hashes only happens once per function name.
#
# Since this obfuscation technique makes analyzing the malware tedious, 
# I wrote a script that resolves those function names.
# 
# Following, a list of resolved functions can be found.
# Hash: ba758c64519be23b5abe7991b71cdcece30525f14e225f2fa07bbffdf406e539
# 
