rule = """rule EmotetXorKey
{
    strings:
       $xstr_1 = { E8 ?? ?? ?? ?? 83 C4 14 6A 00 FF D0 8B E5 5D C3 }
       $xstr_2 = { 8B ?? ?? 8B 4D ?? E8 ?? ?? ?? ?? 35 ?? ?? ?? ?? }
       $xstr_3 = { 8B 46 18 EB ?? }
       $close_key = { 3B 44 24 ?? 74 0C 8B 4C 24 ?? }

    condition:
       all of them
}
"""


def hash_function(function_name):
    i = 0
    for letter in function_name:
        i = (ord(letter) + i * 0x1003f) & 0xffffffff
    return i


def decode_function(searched_function, xor_key):
    for dll in dll_exported_functions:
        for function_name in dll_exported_functions[dll]:
            hash = hash_function(function_name)
            if hash ^ xor_key == searched_function: # new sample
                return(dll, function_name, hex(searched_function))
    return None


def extract_key(emotet_file, strings):
    for s in strings:
        if s[1] == "$close_key":
            with open(emotet_file, 'rb') as f:
                bytearray = f.read()
                key = 0
                counter = -1
                power = 0
                for x in bytearray[s[0]-30:s[0]]:
                    if counter >= 0 and counter < 4:
                        key += x*(2**power)
                        counter += 1
                        power += 8
                    if x == 53:
                        counter = 0
                return key
    return 0


def main(argv):
    parser = argparse.ArgumentParser(description="")
    parser.add_argument('hash', help="Hash of API function")
    parser.add_argument('file', help="Path to unpacked Emotet binary")

    if len(argv) == 0:
        parser.print_help()
        sys.exit(0)

    arguments = parser.parse_args()

    if arguments.hash.startswith("0x"): # base 16
        addr = int(arguments.hash[2:],16)
    else: # base 10
        addr = int(arguments.hash)

    rules = yara.compile(source=rule)
    matches = rules.match(arguments.file)
    if len(matches) > 0:
        key = extract_key(arguments.file, matches[0].strings)
        if key != 0:
            retval = decode_function(addr, key)
            if not retval:
                print("[!] ERROR: Could not resolve this function.")
            else:
                print(retval)
        else:
            print("[!] ERROR: Could not find XOR key in Emotet sample.")
    else:
        print("[!] ERROR: Could not find XOR key in Emotet sample.")


if __name__ == '__main__':
    main(sys.argv)
